import React from "react";
import ProductCard from "../components/ProductCard";

function Home() {
  return (
    <div>
      <div className="text-center my-5">
        <h1>Welcome to JewelStore</h1>
        <p>Discover elegance in every piece.</p>
      </div>
      <h3 className="mb-3">Featured Products</h3>
      <div className="row g-4">
        <div className="col-md-4"><ProductCard image="https://via.placeholder.com/200" title="Diamond Ring" price="50000" /></div>
        <div className="col-md-4"><ProductCard image="https://via.placeholder.com/200" title="Gold Necklace" price="75000" /></div>
        <div className="col-md-4"><ProductCard image="https://via.placeholder.com/200" title="Silver Bracelet" price="10000" /></div>
      </div>
    </div>
  );
}

export default Home;
